(function (Scratch) {
  'use strict';

  const icon = 'data:image/svg+xml;base64,';
  // Logo by Wikipedia

  const isString = value => typeof value === 'string' || value instanceof String;

  const languages_list = [
    {
      text: 'English',
      value: 'en'
    },
    {
      text: 'French',
      value: 'fr'
    },
    {
      text: 'Spanish',
      value: 'es'
    },
    {
      text: 'German',
      value: 'de'
    },
    {
      text: 'Italian',
      value: 'it'
    },
    {
      text: 'Portuguese',
      value: 'pt'
    },
    {
      text: 'Russian',
      value: 'ru'
    },
    {
      text: 'Japanese',
      value: 'ja'
    },
    {
      text: 'Chinese',
      value: 'zh'
    },
    {
      text: 'Arabic',
      value: 'ar'
    },
    {
      text: 'Polish',
      value: 'pl'
    },
    {
      text: 'Egypt',
      value: 'arz'
    },
    {
      text: 'Dutch',
      value: 'nl'
    },
    {
      text: 'Vietnamese',
      value: 'vi'
    },
    {
      text: 'Ukrainian',
      value: 'uk'
    },
    {
      text: 'Swedish',
      value: 'sv'
    },
    {
      text: 'Vietnamese',
      value: 'vi'
    }
  ];

  const hasOwn = (obj, property) =>
    Object.prototype.hasOwnProperty.call(obj, property);

  function json_array_filter(key, json) {
    json = JSON.stringify(json);
    try {
      json = JSON.parse(json);
      return JSON.stringify(
        json.map((x) => {
          if (hasOwn(x, key)) {
            return x[key];
          }
          return null;
        })
      );
    } catch (e) {
      return "";
    }
  }

  class Wikipedia {
    constructor() {
      this.wikipediaLanguages = 'en';
    }

    getInfo() {
      return {
        id: 'samuelloufwikipedia',
        name: 'Wikipedia',
        color1: '#bcbcbc',
        menuIconURI: icon,
        blocks: [
          {
            opcode: 'wikipediafirstparagraph',
            blockType: Scratch.BlockType.REPORTER,
            text: 'first paragraph on [NAME]\'s article',
            disableMonitor: true,
            arguments: {
              NAME: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'Scratch (programming language)'
              }
            }
          },
          {
            opcode: 'wikipediashortphrase',
            blockType: Scratch.BlockType.REPORTER,
            text: 'short phrase about [NAME]',
            disableMonitor: true,
            arguments: {
              NAME: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'Scratch (programming language)'
              }
            }
          },
          {
            opcode: 'wikipediapageurl',
            blockType: Scratch.BlockType.REPORTER,
            text: 'url of page [NAME]',
            disableMonitor: true,
            arguments: {
              NAME: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'Scratch (programming language)'
              }
            }
          },
          {
            opcode: 'wikipediapageexists',
            blockType: Scratch.BlockType.BOOLEAN,
            text: 'does page [NAME] exists?',
            disableMonitor: true,
            arguments: {
              NAME: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: 'Unexistant page'
              }
            }
          },
          '---',
          '---',
          {
            opcode: 'wikipediasetlanguage',
            blockType: Scratch.BlockType.COMMAND,
            text: 'switch wikipedia to [LANGUAGE]',
            arguments: {
              LANGUAGE: {
                type: Scratch.ArgumentType.STRING,
                menu: 'languages',
                defaultValue: 'en'
              }
            }
          },
          {
            opcode: 'wikipedialanguage',
            blockType: Scratch.BlockType.REPORTER,
            text: 'wikipedia\'s language'
          }
        ],
        menus: {
          languages: {
            acceptReporters: false,
            items: languages_list
          }
        }
      };
    }

    wikipediafirstparagraph(args) {
      return fetch(`https://${this.wikipediaLanguages}.wikipedia.org/w/api.php?action=query&prop=extracts&exlimit=1&titles=${encodeURIComponent(args.NAME)}&explaintext=1&exsectionformat=plain&format=json&origin=*`)
        .then((response) => {
          if (response.ok == true) {
            return response.json();
          } else {
            return 'Network Error';
          }
        })
        .then((data) => {
          const pageId = Object.keys(data.query.pages)[0];
          let extract = data.query.pages[pageId].extract;
          extract = extract.replace(/\s{2,}/g, ' ');
          var paragraph = extract.split('\n')[0];
          var splitted_paragraph = paragraph.split('.');
          var result = '';
          for (var i in splitted_paragraph){
            if (i != (splitted_paragraph.length - 1)){
              result = result + splitted_paragraph[i] + '.';
            }
          }
          return result;
        })
        .catch((error) => {
          if (error.message == "Cannot read properties of undefined (reading 'replace')"){
            return 'Error: page does not exist';
          } else {
            return 'Error: ' + error.message;
          }
        });
    }

    wikipediashortphrase(args) {
      return fetch(`https://${this.wikipediaLanguages}.wikipedia.org/w/api.php?action=query&prop=extracts&exlimit=1&titles=${encodeURIComponent(args.NAME)}&explaintext=1&exsectionformat=plain&format=json&origin=*`)
        .then((response) => {
          if (response.ok == true) {
            return response.json();
          } else {
            return 'Network Error';
          }
        })
        .then((data) => {
          const pageId = Object.keys(data.query.pages)[0];
          let extract = data.query.pages[pageId].extract;
          console.log(extract);
          extract = extract.replace(/\s{2,}/g, ' ');
          return extract.split('.').slice(0, 2).join('.') + '.';
        })
        .catch((error) => {
          if (error.message == "Cannot read properties of undefined (reading 'replace')"){
            return 'Error: page does not exist';
          } else {
            return 'Error: ' + error.message;
          }
        }); 
    }

    wikipediapageurl(args) {
      return `https://${this.wikipediaLanguages}.wikipedia.org/wiki/${args.NAME.replace(/\s/g, '_')}`;
    }

    wikipediapageexists(args) {
      return fetch(`https://${this.wikipediaLanguages}.wikipedia.org/w/api.php?action=query&prop=extracts&exlimit=1&titles=${encodeURIComponent(args.NAME)}&explaintext=1&exsectionformat=plain&format=json&origin=*`)
        .then((response) => {
          if (response.ok == true) {
            return response.json();
          } else {
            return 'Network Error';
          }
        })
        .then((data) => {
        return !!data.query.pages[0];
        })
        .catch((error) => {
          return 'Error: ' + error.message;
        });
    }

    // ---
    // ---

    wikipediasetlanguage(args) {
      this.wikipediaLanguages = args.LANGUAGE;
    }

    wikipedialanguage(args) {
      return JSON.parse(json_array_filter('text', languages_list))[JSON.parse(json_array_filter('value', languages_list)).indexOf(this.wikipediaLanguages)];
    }
  }
  Scratch.extensions.register(new Wikipedia());
})(Scratch);
